    "Nest losses in grazed vs. ungrazed waterfowl habitat",nt"tracking_summary":
    {ntt"total": 3,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:06:49.497308",nt"name": "nest-losses-in-grazed-vs-ungrazed-waterfowl-habitat",nt"isopen":
    false,nt"url": null,nt"notes": "A fair number of managers, with student
    help, have just completed a series of dummy nest studies which sampled grazed and
    ungrazed habitat. I have examined 40 separate sample pairs, 7,331 nests, comparing
    these two sites between 1951 and 1965, most of them in 1963-1965. Eight of the 4o
    pairs showed higher loss rates in ungrazed areas; 32 bad higher loss rates in the
    pastures. The average for all, converted to a 35 day period of exposure, was 63
    percent losses in pastures, about 50 percent in idle areas, and 13 percent greater
    loss in grazed pastures. Our data leads me to believe that the standard nesting
    study, which involves flushing hens and visiting nests, may be highly biased, particularly
    in the denser cover types.",nt"license_title": "License Not Specified",nt"extras":
